import React from "react";
import ReactDOM from "react-dom";

const modalElem = document.getElementById("modal");
const RefreshButton = () =>
  ReactDOM.createPortal(
    <>
      <p>Hello, I'm a modal.</p>
    </>,
    modalElem
  );

export default RefreshButton;
